// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

contract CrowdFunding {
    mapping(address => uint) public Contributors;
    address public manager;
    uint public minimumContribution;
    uint public deadLine;
    uint public target;
    uint public raisedAmount;
    uint public noOfContributors;

    struct Request {
        string description;
        address payable recipent;
        uint value;
        uint noOfVoters;
        bool completed;
        mapping ( address => bool) validators;
    }

    mapping (uint => Request) public requests;
    uint public numRequests;

    constructor (uint _deadLine , uint _target) {
        target = _target;
        deadLine = block.timestamp + _deadLine;
        minimumContribution = 1 * 1e16;
        manager = msg.sender; 
    }

    function sendEther () payable public {
        require (block.timestamp < deadLine , "DeadLine has been Passed");
        require (msg.value >= minimumContribution , "You need to send at least 1Eth");
        if(Contributors [msg.sender] == 0) {
            noOfContributors++;
        }
        Contributors [msg.sender] += msg.value;
        raisedAmount += msg.value;   
    }

    function reFund () public {
        require (block.timestamp > deadLine && raisedAmount < target , "You're not eligible to ReFund");
        require (Contributors [msg.sender] > 0 , "You have not deposit any Money");
        address payable user = payable (msg.sender);
        user.transfer(Contributors [msg.sender]);
    }

    function getContractBalance () public view returns (uint) {
        return address(this).balance;
    }

    modifier onlyManager () {
        require (msg.sender == manager , "You are not authorized");
        _;
    }

    function createNewRequest (string memory _description , address payable _recipent , uint _value) public {
        Request storage newRequest = requests [numRequests];
        numRequests++;
        newRequest.description = _description;
        newRequest.recipent = _recipent;
        newRequest.value = _value;
        newRequest.noOfVoters = 0;
        newRequest.completed = false;
    }

    function voteRequest (uint requestNo) public {
        require (Contributors [msg.sender] > 0 , "You must be a Contributor");
        Request storage thisRequest = requests [requestNo];
        require (thisRequest.validators [msg.sender] == false , "You have Already Vote");
        thisRequest.validators [msg.sender] = true;
        thisRequest.noOfVoters++;
    }

    function makePayment (uint requestNo) public {
        require (raisedAmount >= target);
        Request storage thisRequest = requests [requestNo];
        require (thisRequest.completed == false , "The Request has been Completed");
        require (thisRequest.noOfVoters > noOfContributors , "Majority does't Support");
        thisRequest.recipent.transfer(thisRequest.value);
        thisRequest.completed = true;
    }
}

